import React from "react";
import CustomButton from "../CustomButton";

const Login = ({ isSignup = false }) => {
    return <div>{isSignup ? <div>hello</div> :
        <div className="flex flex-col items-center bg-white mx-[30%] my-[5%] py-8 rounded-2xl">
            <span className="text-4xl font-bold text-indigo">Login</span>
            <div className="flex flex-col gap-5 my-4 w-full ">
                <input
                    type="email"
                    placeholder="Email Address"
                    onChange={() => { }}
                    className=" px-3  py-4 rounded-lg mx-5 border border-gray-200  focus:outline-indigo"
                />
                <input
                    type="text"
                    placeholder="Password"
                    onChange={() => { }}
                    className=" px-3 mx-5 py-4 rounded-lg border border-gray-200  focus:outline-indigo"
                />
            </div>
            <div className="flex flex-row justify-between w-full px-5 text-indigo ">
                <div></div>
                <div className="cursor-pointer">Forgot Password?</div>
            </div>
            <div className="mt-5">
                <CustomButton title='Submit' backgroundColor='bg-indigo' textColor='text-white'
                    borderClass={`border-indigo`}
                />
            </div>
            <div className="text-sm">Dont Have an Account? <span className="text-indigo">Sign Up</span></div>
        </div>
    }
    </div>;
};

Login.prototype = {
    isSignup: Boolean,
};

export default Login;
